// mockHTTPTickersInvalid for mocking requests
type mockHTTPTickersInvalid struct{}

// Do is a mock http request
func (m *mockHTTPTickersInvalid) Do(req *http.Request) (*http.Response, error) {
	resp := new(http.Response)
	resp.StatusCode = http.StatusBadRequest

	// No req found
	if req == nil {
		return resp, fmt.Errorf("missing request")
	}

	// Invalid
	if req.URL.String() == apiEndpoint+"/tickers" {
		resp.Body = ioutil.NopCloser(bytes.NewBuffer([]byte(`{"success": false,"message": "Not Found"}`)))
		return resp, fmt.Errorf(`{"success": false,"message": "Not Found"}`)
	}

	// Default is valid
	return resp, nil
}

// TestClient_GetTickers tests the GetTickers()
func TestClient_GetTickers(t *testing.T) {
	t.Parallel()

	t.Run("valid case", func(t *testing.T) {
		client := newMockClient(&mockHTTPTickersValid{})

		tickers, err := client.GetTickers(context.Background())
		assert.NoError(t, err)
		assert.NotNil(t, client)
		assert.NotNil(t, tickers)
		assert.Equal(t, "12eLTxv1vyUeJtp5zqWbqpdWvfLdZ7dGf8", tickers.BsvUsd.ID)

	})

	t.Run("invalid case", func(t *testing.T) {
		client := newMockClient(&mockHTTPTickersInvalid{})
		assert.NotNil(t, client)

		tickers, err := client.GetTickers(context.Background())
		assert.Nil(t, tickers)
		assert.Error(t, err)
	})
}

// TestClient_GetTicker tests the GetTicker()
func TestClient_GetTicker(t *testing.T) {
	t.Parallel()

	// New mock client
	client := newMockClient(&mockHTTPTickersValid{})

	// Create the list of tests
	var tests = []struct {
		input         string
		expected      string
		expectedError bool
		statusCode    int
	}{
		{"12eLTxv1vyUeJtp5zqWbqpdWvfLdZ7dGf8", "12eLTxv1vyUeJtp5zqWbqpdWvfLdZ7dGf8", false, http.StatusOK},
		{"bad-pair-id", "bad-pair-id", false, http.StatusOK},
		{"error", "", true, http.StatusBadRequest},
	}

	// Test all
	for _, test := range tests {
		if output, err := client.GetTicker(context.Background(), test.input); err == nil && test.expectedError {
			t.Errorf("%s Failed: expected to throw an error, no error [%s] inputted", t.Name(), test.input)
		} else if err != nil && !test.expectedError {
			t.Errorf("%s Failed: [%s] inputted, received: [%v] error [%s]", t.Name(), test.input, output, err.Error())
		} else if output != nil && output.ID != test.expected && !test.expectedError {
			t.Errorf("%s Failed: [%s] inputted and [%s] expected, received: [%s]", t.Name(), test.input, test.expected, output.ID)
		} else if client.LastRequest.StatusCode != test.statusCode {
			t.Errorf("%s Expected status code to be %d, got %d, [%s] inputted", t.Name(), test.statusCode, client.LastRequest.StatusCode, test.input)
		}
	}

}

// TestClient_GetTickerHistory tests the GetTickerHistory()
func TestClient_GetTickerHistory(t *testing.T) {
	t.Parallel()

	// New mock client
	client := newMockClient(&mockHTTPTickersValid{})

	// Create the list of tests
	var tests = []struct {
		input         string
		start         int64
		end           int64
		interval      int64
		expected      string
		expectedError bool
		statusCode    int
	}{
		{"12eLTxv1vyUeJtp5zqWbqpdWvfLdZ7dGf8", 0, 0, 0, "b5937d93fcac13ccb5ab10661c8379e44adf22cb2b811aa6659d07bd7432acd1", false, http.StatusOK},
		{"12eLTxv1vyUeJtp5zqWbqpdWvfLdZ7dGf8", 1592940680, 1592953700, 1, "0b7a598dcaec0a0db217cf65efece1db5f5930e2a341f23d6847f22831e56359", false, http.StatusOK},
		{"bad-pair-id", 0, 0, 0, "", false, http.StatusOK},
		{"error", 0, 0, 0, "", true, http.StatusBadRequest},
	}

	// Test all
	for _, test := range tests {
		if output, err := client.GetTickerHistory(
			context.Background(), test.input, test.start, test.end, test.interval,
		); err == nil && test.expectedError {
			t.Errorf("%s Failed: expected to throw an error, no error [%s] inputted", t.Name(), test.input)
		} else if err != nil && !test.expectedError {
			t.Errorf("%s Failed: [%s] inputted, received: [%v] error [%s]", t.Name(), test.input, output, err.Error())
		} else if err == nil && len(output) > 0 && output[0].Tx.Hash != test.expected && !test.expectedError {
			t.Errorf("%s Failed: [%s] inputted and [%s] expected, received: [%v]", t.Name(), test.input, test.expected, output[0].Tx.Hash)
		} else if client.LastRequest.StatusCode != test.statusCode {
			t.Errorf("%s Expected status code to be %d, got %d, [%s] inputted", t.Name(), test.statusCode, client.LastRequest.StatusCode, test.input)
		}
	}
}
